import React, { Component } from 'react'
import '../Styles/ProfilePic.css'

export default class ProfilePic extends Component {
    render() {
        console.log(window.location.origin+'/profile-pic.jpg');
        return (
            <div className="profile-pic">
                <div className="picture" style={{backgroundImage: new URL(window.location.origin+'/profile-pic.jpg')}}></div>
                <div className="my-name">
                    <h2>Rujal Sapkota</h2>
                </div>
            </div>
        )
    }
}
